import React from 'react';

const Users = ( usersList ) => {
    return (
        <div>
            <ul className="users">
                {Object.values(usersList).map( (user,index) => (
                <li key={index}>
                    <div className="user">
                        <span className="sender">{user.username}</span>
                    </div>
                </li>
                ))}
            </ul>
        </div>
    )
}
export default Users;
